import React from "react";

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";

const Carousel = () => {
  return (
    <div>
      <p>Carousel</p>
      <Swiper
        spaceBetween={50}
        slidesPerView={3}
        onSlideChange={() => console.log("slide change")}
        onSwiper={(swiper) => console.log(swiper)}
      >
        <SwiperSlide>
          <img src="./uploads/events/default-event.jpg" alt="event" width="100vh" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="./im" alt="" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="./im" alt="" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="./im" alt="" />
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Carousel;
